{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ibadishtiaq/bellabeat-case-study-for-google-capstone-project?scriptVersionId=147728156\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"e7e30a9c","metadata":{"papermill":{"duration":0.014706,"end_time":"2023-10-23T17:07:01.333689","exception":false,"start_time":"2023-10-23T17:07:01.318983","status":"completed"},"tags":[]},"source":["# **Case Study: Bellabeat**- How can a Wellness Technology Company Play It Smart?\n","## <p style=\"text-align:center;\"> *Ibad Ishtiaq-Google Data Analytics Capstone Case Study Project*</p>"]},{"attachments":{"fc52c5f8-b6d2-4a88-a39d-150e9c12501a.jpg":{"image/jpeg":""}},"cell_type":"markdown","id":"55f2d545","metadata":{"papermill":{"duration":0.010769,"end_time":"2023-10-23T17:07:01.355933","exception":false,"start_time":"2023-10-23T17:07:01.345164","status":"completed"},"tags":[]},"source":["![bellabeat2.jpg](attachment:fc52c5f8-b6d2-4a88-a39d-150e9c12501a.jpg)"]},{"cell_type":"markdown","id":"b68a35bc","metadata":{"papermill":{"duration":0.011053,"end_time":"2023-10-23T17:07:01.377717","exception":false,"start_time":"2023-10-23T17:07:01.366664","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"e4bc8ed1","metadata":{"papermill":{"duration":0.010651,"end_time":"2023-10-23T17:07:01.399005","exception":false,"start_time":"2023-10-23T17:07:01.388354","status":"completed"},"tags":[]},"source":["## Purpose:\n","\n","Hello, everyone, I have been doing the Google Data Analytics Professional Certificate through Coursera for the past few months. This is the course's last capstone project for me. In this case study, I will be examining a public dataset for Bellabeat, a wellness technology startup, which was provided by the course. I will be emulating a few of the actual duties of a junior data analyst in this case study."]},{"cell_type":"markdown","id":"64ae0864","metadata":{"papermill":{"duration":0.010627,"end_time":"2023-10-23T17:07:01.420375","exception":false,"start_time":"2023-10-23T17:07:01.409748","status":"completed"},"tags":[]},"source":["## Scenario:\n","\n","At Bellabeat, a high-tech producer of products health-focused for women, you are a member of the marketing analyst team. Even though Bellabeat is a small but successful business, they have the potential to dominate the global market for smart devices. Bellabeat's co-founder and chief creative officer, Urška Sršen, thinks that studying fitness data from smart devices could help the business discover new growth potential. To better understand how consumers use their smart devices, Bellabeat wants you to concentrate on one of its products and evaluate data from connected devices. After then, the company's marketing approach will be guided by the insights you find. In addition to providing high-level recommendations for Bellabeat's marketing strategy, you will submit your study to the leadership management of Bellabeat.\n"]},{"cell_type":"markdown","id":"64773414","metadata":{"papermill":{"duration":0.01063,"end_time":"2023-10-23T17:07:01.441845","exception":false,"start_time":"2023-10-23T17:07:01.431215","status":"completed"},"tags":[]},"source":["## About the Company:\n","\n"," Bellabeat is a high-tech business that creates innovative products with a focus on health that was formed by Urška Sršen and Sando Mur.\n","    \n","Sršen used her training as an artist to create elegantly crafted technology that educates and empowers women all around the world. With the use of data collection on activity, sleep, stress, and health, Bellabeat has been able to educate women about their own habits and health. Bellabeat has rapidly expanded since its founding in 2013 and established itself as a tech-driven health firm for women. Bellabeat has established offices all around the world by 2016 and had introduced several products. In addition to their own e-commerce channel on their website, an increasing number of online shops started selling Bellabeat products.\n","    \n","Sršen is aware that a review of Bellabeat's consumer data would highlight additional growth prospects. To obtain insight into how people are currently using their smart devices, she has requested the marketing analytics team to concentrate on a Bellabeat product and examine smart device usage statistics. Then, based on this knowledge, she would need high-level suggestions on how these trends can influence Bellabeat's marketing plan.\n"]},{"cell_type":"markdown","id":"b795e9bf","metadata":{"papermill":{"duration":0.010822,"end_time":"2023-10-23T17:07:01.46316","exception":false,"start_time":"2023-10-23T17:07:01.452338","status":"completed"},"tags":[]},"source":["## Data Analysis Process:\n","\n","To answer the key business questions, throughout the case study I will be following the steps of the data analysis process: **ask, prepare, process, analyze, share, and act**. Moreover, these questions will guide my analysis: \n","\n","*  What are some trends in smart device usage? \n","*  How could these trends apply to Bellabeat customers? \n","*  How could these trends help influence Bellabeat marketing strategy? \n","\n"]},{"cell_type":"markdown","id":"8b78d79d","metadata":{"papermill":{"duration":0.010643,"end_time":"2023-10-23T17:07:01.484988","exception":false,"start_time":"2023-10-23T17:07:01.474345","status":"completed"},"tags":[]},"source":["# 1. Ask\n","\n","Through consumer data of their current usage of smart health apps, insights can be identified and understood which can be applied to current Bellabeat’s comparable products to optimize their marketing strategy for it. Hence, the problem that I am trying to solve with this case study is finding opportunities for growth of Bellabeat by understanding smart devices data (Fitbit fitness tracker data). High-level recommendations can be made to Bellabeat marketing department to then use these insights to drive their business decisions. In essence, the business task is as follows:\n","\n","**Business Task:** What are typical usage patterns for smart devices such as Fitbit fitness tracker, how these apply to Bellabeat’s devices, how can Bellabeat consumers benefit from them, and how might these patterns affect the company's marketing plan?"]},{"cell_type":"markdown","id":"ccfd3ff3","metadata":{"papermill":{"duration":0.010517,"end_time":"2023-10-23T17:07:01.506178","exception":false,"start_time":"2023-10-23T17:07:01.495661","status":"completed"},"tags":[]},"source":["# 2. Prepare\n","\n","The data and dataset used for this case study is taken from [Fitbit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit?resource=download) on Kaggle and is publicly available for everyone. The dataset is divided into 18 CSV files showing the tracking of personal fitness of 33 Fitbit users in the form of daily and minute by minute activity, intensity, calories, and steps taken. Moreover, sleep and weight log information can also be found. \n","\n","This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk (a third-source party) between April 12, 2016, to May 12, 2016. Thirty respondents in the survey gave their consent for the usage of the tracking data, clearing any licensing and privacy issues with it. However, since the data was collected in a survey by a third-party source, its integrity at the time of data collection cannot be ascertained by me. Though, data cleaning and data accuracy checks will be done later in the Process stage to ensure the integrity of data.\n","\n","ROCCC data is an abbreviation for reliable, original, comprehensive, current, and cited data. In the context of this case study dataset, the data can be termed as having **mediocre reliability** as the sample population was only thirty users, but the sampling bias cannot be determined. The data is also from third-party sources leading to it being **low in originality**. The data ranks **good in comprehensiveness** as it does not seem to be missing any information. Since the data is 7 years old, the data may be outdated as the various parameters of this like average steps taken or sleep activity may have changed over the years. Hence, it is **low in being current**. Lastly, the citation of the data is done by Mobius (the user on Kaggle who provided the dataset) [here](https://zenodo.org/record/53894#.YMoUpnVKiP9).\n"]},{"cell_type":"markdown","id":"a51b2e11","metadata":{"papermill":{"duration":0.010939,"end_time":"2023-10-23T17:07:01.527763","exception":false,"start_time":"2023-10-23T17:07:01.516824","status":"completed"},"tags":[]},"source":["In order to complete this case study, I would be using R programming language as it would allow me to easily work with all the datasets and provide visualizations quickly. To get started with the preparation, we need to first install packages that are going to be used for our work."]},{"cell_type":"code","execution_count":1,"id":"e32385cd","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2023-10-23T17:07:01.553767Z","iopub.status.busy":"2023-10-23T17:07:01.55163Z","iopub.status.idle":"2023-10-23T17:09:15.70283Z","shell.execute_reply":"2023-10-23T17:09:15.700911Z"},"papermill":{"duration":134.167044,"end_time":"2023-10-23T17:09:15.705686","exception":false,"start_time":"2023-10-23T17:07:01.538642","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘dplyr’ had non-zero exit status”\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["## installing packages that are going to be used\n","install.packages(\"tidyverse\")\n","install.packages(\"dplyr\")\n","install.packages(\"tidyr\")\n","install.packages(\"readr\")\n","install.packages(\"janitor\")\n","install.packages(\"skimr\")"]},{"cell_type":"markdown","id":"44ab469c","metadata":{"papermill":{"duration":0.011468,"end_time":"2023-10-23T17:09:15.732039","exception":false,"start_time":"2023-10-23T17:09:15.720571","status":"completed"},"tags":[]},"source":["After installing our packages we would need to set up the environment in which we will be working."]},{"cell_type":"code","execution_count":2,"id":"d787ce11","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:09:15.785504Z","iopub.status.busy":"2023-10-23T17:09:15.755905Z","iopub.status.idle":"2023-10-23T17:09:16.529623Z","shell.execute_reply":"2023-10-23T17:09:16.527786Z"},"papermill":{"duration":0.788926,"end_time":"2023-10-23T17:09:16.53197","exception":false,"start_time":"2023-10-23T17:09:15.743044","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]}],"source":["## setting up the environment\n","library(tidyverse)\n","library(dplyr)\n","library(tidyr)\n","library(readr)\n","library(janitor)\n","library(lubridate)\n","library(skimr)\n","library(ggplot2)"]},{"cell_type":"markdown","id":"dd11fae2","metadata":{"papermill":{"duration":0.012002,"end_time":"2023-10-23T17:09:16.555451","exception":false,"start_time":"2023-10-23T17:09:16.543449","status":"completed"},"tags":[]},"source":["Next, we now need to import those files from the dataset with which we would work. I would be importing 4 data files from the 18 files."]},{"cell_type":"code","execution_count":3,"id":"84cdaa94","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:09:16.58689Z","iopub.status.busy":"2023-10-23T17:09:16.584738Z","iopub.status.idle":"2023-10-23T17:09:16.731906Z","shell.execute_reply":"2023-10-23T17:09:16.72843Z"},"papermill":{"duration":0.163885,"end_time":"2023-10-23T17:09:16.735098","exception":false,"start_time":"2023-10-23T17:09:16.571213","status":"completed"},"tags":[]},"outputs":[],"source":["## storing data tables in variables\n","daily_activity <- read.csv(\"/kaggle/input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\n","sleep_day <- read.csv(\"/kaggle/input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")\n","weight_log <- read.csv(\"/kaggle/input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\")\n","hourly_intensity <- read.csv(\"/kaggle/input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlyIntensities_merged.csv\")"]},{"cell_type":"markdown","id":"b7aa0fef","metadata":{"papermill":{"duration":0.01147,"end_time":"2023-10-23T17:09:16.758123","exception":false,"start_time":"2023-10-23T17:09:16.746653","status":"completed"},"tags":[]},"source":["The files that have been imported are as follows:\n","* **daily_activity:** This file contains daily data about the users in reference of their total steps taken, number of calories burnt,the distance and minutes of sedentary, light, fairly active, and very active activities. \n","* **sleep_day:** This file contains daily sleep data of users which inludes time spent on bed and the time sleeping.\n","* **weight_log:** This file contains weight data of users and tracks their weight whenever the feature has been used on a day to day basis.\n","* **hourly_intensity:** This file contains data about intensity levels on an hourly period.The total activity intensity level, which indicates the intensity level of physical activity, was calculated by summing the minute-level intensity values that occurred within an hour. Intensity level for the given minute was as follows: 0 – Sedentary, 1- Light, 2 – Moderate, and 3 – Very Active.\n","\n","To better understand the data files we can use the str() funtion to see the structure of each files which includes the column names, their data type, and few values of those columns."]},{"cell_type":"code","execution_count":4,"id":"f1521148","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:09:16.78559Z","iopub.status.busy":"2023-10-23T17:09:16.783835Z","iopub.status.idle":"2023-10-23T17:09:16.818843Z","shell.execute_reply":"2023-10-23T17:09:16.816056Z"},"papermill":{"duration":0.052166,"end_time":"2023-10-23T17:09:16.822234"