ummarize(average_total_intensity = mean(total_intensity))\n","\n","## making a bar chart to show the daily intensity done by users\n","ggplot(data = daily_intensity_day) + \n","  geom_col(mapping = aes(x = hourly_intensity_day, y = average_total_intensity, fill = \"peachpuff\")) +\n","  labs(title = \"Average Total Intensity per Day\", x = \"Week Day\", y = \"Intensity Level\") +\n","  theme(plot.title = element_text(hjust = 0.5)) +\n","  guides(fill = \"none\")"]},{"cell_type":"markdown","id":"636237d2","metadata":{"papermill":{"duration":0.016732,"end_time":"2023-10-23T17:09:19.27311","exception":false,"start_time":"2023-10-23T17:09:19.256378","status":"completed"},"tags":[]},"source":["* From this bar chart it can be seen that users are most active on Saturday. On Saturday, people usually have more time to do some exercising and do some lightly active activities. On the contrary, people are the least active on Sundays as their intensity level is lowest on this day. This could be due to people opting for relaxation in their homes after doing some activities on Saturday."]},{"cell_type":"markdown","id":"607a5fa0","metadata":{"papermill":{"duration":0.016126,"end_time":"2023-10-23T17:09:19.305253","exception":false,"start_time":"2023-10-23T17:09:19.289127","status":"completed"},"tags":[]},"source":["### Average total intensity per Hour \n","\n","In order to get even more details about this we can calculate on an hourly basis too for the whole day in a bar chart."]},{"cell_type":"code","execution_count":21,"id":"f60200ae","metadata":{"execution":{"iopub.execute_input":"2023-10-23T17:09:19.342234Z","iopub.status.busy":"2023-10-23T17:09:19.340625Z","iopub.status.idle":"2023-10-23T17:09:19.663639Z","shell.execute_reply":"2023-10-23T17:09:19.661742Z"},"papermill":{"duration":0.344619,"end_time":"2023-10-23T17:09:19.665976","exception":false,"start_time":"2023-10-23T17:09:19.321357","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAA